import React from "react";
import styled from "styled-components";

const SloganDomain = styled.div`
  width: 26vw;
  height: 35vh;
  background: green;
  margin-left: 300px;
  margin-top: 150px;
`;

function Slogan_Domain() {
  return (
    <>
      <SloganDomain>
        <h1>함께하고, 성장하는, 소통하는 Endless Creation</h1>
      </SloganDomain>
    </>
  );
}

export default Slogan_Domain;
